description:
Tire customization now added!
CODE: ALPHA

Version: Alpha v.1.1.

• Over 180+ unique cars to buy! 
• Great car customization!
• Advanced tuning!
• 7 different maps! 
• Challenge different players! 
____
MRT is a racing sim-cade where you can buy and customize between 180+ different unique cars to drive in a virtual recreation of Tokyo, Japan with its large highways and twisting mountain passes. Upgrade and modify your vehicle to advance in the ranks, communicate with your friends and compete with other players for money and status! This game is still in development. Expect bugs and unfinished features.

Follow the devs!
